# Iterate over each book
for book in g.subjects(RDF.type, ns1.Book):
    # Get the book name
    book_name = str(g.value(book, ns1.name)).lower()

    for index, name in enumerate(list_name):
        # Check if book name is similar to a name in the list
        similarity_score = difflib.SequenceMatcher(None, book_name, name).ratio()

        if similarity_score > 0.85:
            # Print the matching book name and the name from the list
            print(f'{book_name} : {name}')

            # Add the constellationLink attribute to the book with corresponding URL
            g.add((book, constellationLink, Literal(list_links[index])))

# Save the updated graph
with open("books.ttl", "w", encoding="utf-8") as f:
    f.write(g.serialize(format="turtle"))
